export default class Home extends Component {
  render() {
    return (
      <div>
        <h1>Friendzone</h1>
        <Link to="/login">Login</Link>
        <Link to="/signup">Sign Up</Link>
        {/* <button className="login-button" path="/login">Login</button>
        <button className="signup-button" path="/signup">Sign Up</button> */}
      </div>
    )
  }
}
